import styled from 'styled-components';

const SearchInput = styled.input`
  width: 70%;
  height: fit-content;
  border-radius: 0.5rem;
  border: none;
  outline: none;
  background-color: transparent;
  padding: 0.5rem;
  font-size: 18px;
  cursor: pointer;
`;

export default SearchInput;
